	void setPoints(Common::Array<cocos2d::Point>& path, double level[24][2])
	{
		for(int i = 0; i < 24; i++)
		{
			double x = level[i][0];
			double y = level[i][1];
			y = Main::LEVEL_MAP_HEIGHT - y; 
			path[i] = cocos2d::Point(x, y);
		}
	}
